import React from "react";
import { Col, Form } from "react-bootstrap";
import { useForm } from "react-hook-form";

const AddService = () => {
  const {
    register,
    handleSubmit,
    watch,
    formState: { errors },
  } = useForm();
  const onSubmit = (data) => console.log(data);
  return (
    <div className="w-75">
      <form onSubmit={handleSubmit(onSubmit)}>
        <label htmlFor="time">Service Title</label>
        <input
          className="form-control"
          type="text"
          defaultValue=""
          {...register("title")}
        />
        <label htmlFor="name">Cloths</label>
        <input
          className="form-control"
          type="number"
          {...register("cloths", { required: true })}
        />
        <label htmlFor="phone">Shirt</label>
        <input
          className="form-control"
          type="number"
          {...register("shirt", { required: true })}
        />
        <label htmlFor="email">Pant</label>
        <input
          className="form-control"
          type="number"
          {...register("pants", { required: true })}
        />
        <label htmlFor="email">sweaters</label>
        <input
          className="form-control"
          type="number"
          {...register("sweaters", { required: true })}
        />

        <br />
        <input className="btn btn-danger" type="submit" />
      </form>
    </div>
  );
};

export default AddService;
